import Head from 'next/head';
import styled from 'styled-components';

const AboutStyles = styled.div`
  display: grid;
  grid-template-columns: 1fr 3fr 1fr;
  align-items: center;
  #main {
    grid-column: 2;
    width: 100%;
    margin-top: 1vh;
    margin-bottom: 50vh;
    padding: 25px;
    padding-right: 50px;
  }
`;

export default function Account() {
  return (
    <AboutStyles>
      <Head>
        <title>Ataire | Account </title>
      </Head>
      <div id="main">
        <h1>About</h1>
        <p>Content</p>
      </div>
    </AboutStyles>
  );
}
